import React, { Component } from 'react';

class priceList extends Component {
    render() {
        return (
            <div>
                <h1>Price List</h1>
                <h2>Grooming Rates</h2>
                <h3>Full Groom</h3>
                <p>Small Dogs --- $35.00</p>
                <p>Medium Dogs --- $40.00</p>
                <p>Large Dogs --- $45.00</p>
                <p>XL Dogs --- $60.00</p>

                <h2>Baths Only</h2>
                <p>Small Dogs --- $35.00</p>
                <p>Medium Dogs --- $40.00</p>
                <p>Large Dogs --- $45.00</p>
                <p>XL Dogs --- $60.00</p>
            </div>
        );
    }
}

export default priceList;
